import './tasks.scss';

function Tasks({ lists }) {
    return (
        <div className="tasks">
            <h2 className="tasks__title">
                {lists.name}
                <img alt="Edit icon" />
            </h2>

            <div className="tasks__items">
                <h2>Задачи отсутствуют</h2>

            </div>
        </div>
    );
}

export default Tasks;
